import React, { useEffect, useState } from 'react'
import { count } from '../store/reducers/exampleReducer'
import Header from '../components/Header'
import HeaderContent from '../components/HeaderContent'
import Footer from '../components/Footer'
import { configureStore, createSlice } from '@reduxjs/toolkit'
import { useSelector, useDispatch } from 'react-redux'

const Article3 = () => {
  const userManagamentSlice = createSlice({
    name: "userManagament",
  });

  useEffect(() => {
    setTimeout(() => {
      window.location.href = "#article"
    }, 250);
  }, [])

  const store = configureStore({
    reducer: userManagamentSlice.reducer,
  });
  const { images, imagess, countt } = useSelector((state) => state.userManagament);
  const dispatch = useDispatch();

  return (
    <div id='article'>
      <Header />
      <div className="w-full min-h-[90vh] max-h-[90vh] flex items-center h-full bg-[#f2f2f2] p-4">
        <div className="m-auto container grid grid-cols-2 bg-stone-200 grid h-full h-fit p-8">
          <div className="flex h-[70vh]">
            <img src={imagess[countt].id} className='h-full w-full object-cover' alt="" />
          </div>
          <div className="w-full h-full flex flex-col p-10 overflow-hidden">
            <span className='font-bold text-4xl'>Dortmund</span>
            <p className='mt-10 leading-6'>SoovHome'un Dortmund koltuk takımı, rahatlık arayışınızı bir üst seviyeye taşıyor. Derin oturma alanları ve ergonomik tasarımı ile uzun sohbetlere, keyifli film gecelerine ve dinlendirici anlara ev sahipliği yapıyor. Gelişmiş teknolojilerle donatılmış yüksek kaliteli malzemeler, uzun ömürlü ve konforlu bir kullanım vadediyor.</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  )
}

export default Article3
